import React  from 'react'
import './experience_template.css'
import { TimelineItem }  from 'vertical-timeline-component-for-react';

{/* Template */}

    
const Experience_Template = ( { data }  ) => (


  <TimelineItem
    dateText={data.date_range}
    style={{ color: data.color }}
  >
    <h3>{data.job_title}, {data.company_name}</h3>
    <h4>{data.subtitle}</h4>
    <p>{data.paragraph_1}</p>
    <p>{data.paragraph_2}</p>
    <p>{data.paragraph_3}</p>
    <div dangerouslySetInnerHTML={{__html:data.paragraph_1}}></div>
  </TimelineItem>
);

export default Experience_Template;
